class InputBox:
    def __init__(self,master,title='输入对话框',prompt='请输入字符:'):
        
        self.askwindow = TK.Toplevel(master) # 新建询问窗口
        self.askwindow.transient(master)  # 去掉最小化和最大化按钮
        self.askwindow.withdraw()         # 隐藏
        self.prompt = prompt
        self.askwindow.title(title)
        self.askwindow.resizable(0,0)
        
        self.value = ''                   # 保存输入的字符串  
        m_x = master.winfo_rootx()
        m_y = master.winfo_rooty()
        p_width= master.winfo_width()
        p_height= master.winfo_height()
        s_width= self.askwindow.winfo_width()
        s_height= self.askwindow.winfo_height()        

        width = p_width//3              # 询问窗口宽度
        height = 60                     # 询问窗口高度
        left = m_x + (p_width-width)//2 # 询问窗口距父窗口左x距离
        top = m_y + p_height - height*2
        
        self.askwindow.geometry("%dx%d+%d+%d" % (width,height,left,top))
        self.frame = TK.Frame(self.askwindow)         # 框架
        self.frame.pack()
        self.l=TK.Label(self.frame,text=self.prompt)  # 框架里的提示标签
        self.l.grid(row=0,column=1,columnspan=3)
        self.e = TK.Entry(self.frame,width=p_width//24)
        self.e.grid(row=1,column=1,columnspan=3)
        self.e.bind("<Return>",lambda event:self.cleanup())
        self.e.bind("<Escape>",lambda event:self.askwindow.destroy()) # 按取消键销毁窗口
        self.b = TK.Button(self.frame,text=' 确  定 ', command=self.cleanup)
        self.b.grid(row=2,column=1)
        self.c = TK.Button(self.frame,text=' 取  消 ', command=self.askwindow.destroy)
        self.c.grid(row=2,column=2)

        # 创建菜单
        self.the_menu = TK.Menu(self.askwindow, tearoff=0)
        self.the_menu.add_command(label="剪切")
        self.the_menu.add_command(label="复制")
        self.the_menu.add_command(label="粘贴")
        self.the_menu.add_separator()
        self.the_menu.add_command(label="全选")
        #绑定到所有文本输入框(Entry),实现单击右键弹出菜单
        self.askwindow.bind_class("Entry", "<Button-3><ButtonRelease-3>", self.show_textmenu)
        self.askwindow.bind_class("Entry", "<Control-a>", self.callback_select_all)
        
        self.askwindow.deiconify()  #显示
        self.e.focus_set()
        
        self.askwindow.wait_visibility()
        self.askwindow.grab_set()        
        self.askwindow.wait_window(self.askwindow)
        
    def cleanup(self):
        self.value=self.e.get()
        self.askwindow.destroy()
        
    def callback_select_all(self,event):
	    # 50毫秒后全选文本
        self.askwindow.after(50, lambda:event.widget.select_range(0, 'end'))

    def show_textmenu(self,event):
        e_widget = event.widget
        self.the_menu.entryconfigure("剪切",command=lambda: e_widget.event_generate("<<Cut>>"))
        self.the_menu.entryconfigure("复制",command=lambda: e_widget.event_generate("<<Copy>>"))
        self.the_menu.entryconfigure("粘贴",command=lambda: e_widget.event_generate("<<Paste>>"))
        self.the_menu.entryconfigure("全选",command=lambda: e_widget.select_range(0, 'end'))
        self.the_menu.tk.call("tk_popup", self.the_menu, event.x_root, event.y_root)
        
def makerndfilename(ext=''):
    """生成随机文件名,
    参数: ext表示扩展名,如.png
    举例:fn = makerndfilename('.txt')
    """
    s = 'abcdefghijklmnopqrstuvwxyz0123456789'
    t = time.localtime()
    year = str(t.tm_year)
    mon = str(t.tm_mon)
    day = str(t.tm_mday)
    minu = str(t.tm_min)
    sec = str(t.tm_sec)
    shijian = [year,mon,day,minu,sec]
    r = [random.choice(s) for _ in range(4)]
    shijian.extend(r)
    s =  "".join(shijian) + ext
    return s    
    
def _set_im_alpha(im,alpha):
    """im是用Image.open打开的转换成RGBA的图形对象。
       本函数设置im的透明度，但不像putalpha那样眉毛胡子一把抓似地
       把所有像素的透明度都设为alpha值(结果会有黑底)，而是只有不透明像素才设置。
       黑边问题待解决！
    """
    array = np.array(im)   
    a =  array[:,:,3:]        # 提取透明通道所有值
    a = np.where(a>0,alpha,0) # 如果透明度大于0,则设为alpha,否则为0    
    array[:,:,3:] = a         # 把array的透明度全部改为a
    return Image.fromarray(array)

# 重定义Tpen类的_reset方法,让角色实例化时不落笔
def TPen_reset(self, pencolor=_CFG["pencolor"],
                 fillcolor=_CFG["fillcolor"]):
    self._pensize = 1
    self._shown = False
    self._pencolor = pencolor
    self._fillcolor = fillcolor
    self._drawing = False
    self._speed = 0
    self._stretchfactor = (1., 1.)
    self._shearfactor = 0.
    self._tilt = 0.
