# 以下覆盖RawTurtle的_goto方法，原因是currentLine这个列表长度为42会自动调用_newline方法，把42改成420
def RawTurtle_goto(self, end): 
    """当画笔落下时，就会有轨迹地移到end坐标点，所有其它的移动相关方法最终都调用这个方法。
      本方法主要来自turtle.py，本人稍加改动。
    """
    screen = self.screen
    
    # 可撤销的几个go模式项目
    go_modes = ( self._drawing,
                 self._pencolor,
                 self._pensize,
                 isinstance(self._fillpath, list))
    
    undo_entry = ("go", self._position, end, go_modes,
                  (self.currentLineItem,
                  self.currentLine[:],
                  screen._pointlist(self.currentLineItem),
                  self.items[:])
                  )
    if self.undobuffer:
        self.undobuffer.push(undo_entry)
    start = self._position
    if self._speed and screen._tracing == 1:
        diff = (end-start)
        diffsq = (diff[0]*screen.xscale)**2 + (diff[1]*screen.yscale)**2
        nhops = 1+int((diffsq**0.5)/(3*(1.1**self._speed)*self._speed))
        delta = diff * (1.0/nhops)
        for n in range(1, nhops):
            if n == 1:
                top = True
            else:
                top = False
            self._position = start + delta * n # 分步移动
            if self._drawing:                  # 如果在画画中
                screen._drawline(self.drawingLineItem,  
                                 (start, self._position),
                                 self._pencolor, self._pensize, top)
            self._update()
        if self._drawing:
            screen._drawline(self.drawingLineItem, ((0, 0), (0, 0)),
                                           fill="", width=self._pensize)
    # 海龟到达终点了
    if self._drawing: # 如果是在绘画中，则添加currentLine列表中
        self.currentLine.append(end)
    if isinstance(self._fillpath, list):# 如果在填充中，则加到_fillpath列表中
        self._fillpath.append(end)
    #  遗产
    self._position = end
    if self._creatingPoly:     # 如果在记录顶点坐标，则加到列表
        self._poly.append(end)
    if len(self.currentLine) > 420: # 42! 宇宙万物生灵之超级答案(原为大于42)
        self._newLine()

    self._update() #count=True)
RawTurtle._goto = RawTurtle_goto


# 给原生海龟增加slide，别名glide方法
def RawTurtle_slide(self,pos,delay=2000,update=False):
    """滑行到某个坐标点. 
       pos：x,y坐标,元组或者列表,如果不是这两个,则先处理一下
       delay：以毫秒为单位的滑行总时间
       在规定的时间内滑动到坐标，无返回值。
    """
    # 处理pos不是列表或者元组的情况
    if not isinstance(pos,(tuple,list)):# 不是列表或者元组,当成当x值
        pos = (pos,self.ycor())
    
    old_delay = self.screen.delay()     # 获取当前绘画延时时间
    self.screen.delay(0)
    delay = abs(delay)    
    if delay > 10:
      delay = int(delay)     
      h_distance = pos[0] - self._position[0]
      v_distance = pos[1] - self._position[1]
      dx = 10 * h_distance/delay              # 每毫秒在水平方向移动的距离
      dy = 10 * v_distance/delay              # 每毫秒在垂直方向移动的距离  
      for _ in range(delay//10):
        start = time.time()
        self.move(dx,dy)
        if update==True:self.screen.update()
        splent_time  = time.time() - start
        waited_time = 0.01 - splent_time
        if waited_time > 0: time.sleep(waited_time)      
    else:
        self.goto(pos)
    self.screen.delay(old_delay)
    
RawTurtle.slide = RawTurtle_slide
RawTurtle.glide = RawTurtle_slide

# 给原生海龟增加update方法，为的是能单独渲染一个角色
def RawTurtle_update(self):
    """重新刷新对象"""
    tracing = self.screen._tracing
    self.screen._tracing = True
    self._update_data()
    self._drawturtle()
    self.screen._update()
    self.screen._tracing = tracing
RawTurtle.update = RawTurtle_update

# 重定义原生海龟的_drawturtle方法
def RawTurtle_drawturtle(self):
    """根据倾斜角度，伸展因子，重调模式等重新渲染海龟对象的外形。"""
    screen = self.screen
    shape = screen._shapes[self.turtle.shapeIndex]
    ttype = shape._type
    titem = self.turtle._item
    if self._shown and screen._updatecounter == 0 and screen._tracing > 0:
        self._hidden_from_screen = False
        tshape = shape._data
        if ttype == "polygon":
            if self._resizemode == "noresize": w = 1
            elif self._resizemode == "auto": w = self._pensize
            else: w =self._outlinewidth
            shape = self._polytrafo(self._getshapepoly(tshape))
            fc, oc = self._fillcolor, self._pencolor
            # 如果alpha值，即透明度为0，则没有填充颜色和线宽，这样就看不到海龟的外形了。
            # 但又把它“画”了出来，这样绑定盒命令就能获取正确的值。如果隐藏，就获取不到了。
            if self._alpha == 0 :
               fc = ""
               w = 0
               oc = ""
            screen._drawpoly(titem, shape, fill=fc, outline=oc,
                                                  width=w, top=True)
        elif ttype == "image":
            screen._drawimage(titem, self._position, tshape)
        elif ttype == "compound":
            for item, (poly, fc, oc) in zip(titem, tshape):
                poly = self._polytrafo(self._getshapepoly(poly, True))
                # 如果alpha值即透明度为0，则无填充颜色和线宽，这样就看不到海龟的外形了。
                if self._alpha == 0 :
                    screen._drawpoly(item, poly, fill="",
                                 outline=0, width=0, top=True)
                else:                  
                    screen._drawpoly(item, poly, fill=self._cc(fc),
                                 outline=self._cc(oc), width=self._outlinewidth, top=True)
    else:
        if self._hidden_from_screen:
            return
        if ttype == "polygon":
            screen._drawpoly(titem, ((0, 0), (0, 0), (0, 0)), "", "")
        elif ttype == "image":
            screen._drawimage(titem, self._position,
                                      screen._shapes["blank"]._data)
        elif ttype == "compound":
            for item in titem:
                screen._drawpoly(item, ((0, 0), (0, 0), (0, 0)), "", "")
        self._hidden_from_screen = True
RawTurtle._drawturtle = RawTurtle_drawturtle
            
