# 给TurtleScreen类增加_capture方法
def TurtleScreen_capture(self):
    """ 生成一个随机文件名然后截屏"""
    filename =  os.getcwd() + os.sep + makerndfilename(".png")
    self.save(filename)    
    if os.path.isfile(filename):
      showinfo("恭喜",'成功截屏到\n\n' + filename)
    else:
      showwarning('出错','截屏不成功,请自行检测是什么原因')
