def askshape(i=None):
    """返回内置图片数量，或者根据编号i显示相关图片，或者i为字符串的话，则查找图片在_built_in_images中的索引。
      用法1：askshape() 返回图片数量
      用法2；askshape(2) 返回2对应的图片
      用法3：askshape('rat') 返回第一个找到的含有'rat'的图片在_built_in_images中的索引
    """
    if i==None:return _builtinpicamount
    if isinstance(i,int) and -_builtinpicamount <= i < _builtinpicamount:
        tmppic = BytesIO(base64.b64decode(_built_in_picbytes[i])) # 从_built_in_picbytes列表中取图的所有字节
        tmppic = Image.open(tmppic)
        #tmppic.save(os.path.join(_resfld,_built_in_images[i]))        
