def three_point_order(A,B,C):
    """判断三点顺序，逆时针或者顺时针，亦可用于判断三点是否共线，
       返回值大于0表示三点逆时钟顺序，小于0表示顺时钟，等于0表示三点共享。"""
    x1,y1 = A
    x2,y2 = B
    x3,y3 = C
    r = (x2-x1)*(y3-y1)-(y2-y1)*(x3-x1)
    # r大于0，逆时钟，r<0顺时针，r==0共线
    return r

def pick_point(A,C,k=2):  # 在经过A和C点的直线上取点
    """在经过A和C点的直线上取点。
       A是个点,C是个点,以二元组表示,假设它们之间的点叫D,则k是AD/DC的比值
       这个函数根据k的大小返回D的坐标.
    """
    x1,y1 = A;x2,y2 = C
    x = (x1 + k*x2) / (k+1)
    y = (y1 + k*y2) / (k+1)
    return x,y
pickpoint = pick_point

def midpoint(p1,p2):
    """返回p1,p2之间的中点"""
    return pick_point(p1,p2,1)

def twopointoneline(p1,p2):
    """两点一线函数，根据两个点返回直线方程的系数。
    p1,p2表示坐标点,用二元组表示,本函数根据两点返回一元一次方程一般式的A,B,C,k,b"""
    x1,y1 = p1
    x2,y2 = p2
    dx = x1 - x2
    if dx==0:
        k = b = float('inf')
    else:
        k = (y1-y2)/dx
        b = (x1*y2-x2*y1)/dx
    A = y2 - y1
    B = dx
    C = (x2*y1-x1*y2)
    return A,B,C,k,b
twopaline = twopointoneline    # 两点一线的别名
twodotaline = twopointoneline

def kpointoneline(point,k):
    """利用直线方程的点斜式返回直线标准方程的A，B，C。
       point表示坐标点,用二元组表示,k表示斜率,本函数根据一个点和斜率返回一元一次方程一般式的A,B,C"""
    p = point
    if k==float('inf'):               # float('inf')表示无穷大
        A = 1;B=0;C= -p[0]
    else:
        A = -k;B=1;C=k*p[0] - p[1]
    return A,B,C
pkaline = kpointoneline

def line_intersection(line1,line2):
    """两根直线的交叉点,line1,line2都是((10,10),(20,20))或[(10,10),(20,20)]这样的"""
    A1,B1,C1,*x = twopointoneline(*line1)
    A2,B2,C2,*x = twopointoneline(*line2)
    m = A1*B2 - A2*B1
    if m==0:return None
    x = (C2*B1-C1*B2)/m
    y = (C1*A2-C2*A1)/m
    return x,y

def point_is_on_line(point,line):
    """判断点是否在直线上,point:二元组表示的点，line:两个点表示的直线"""
    P,Q = line
    A,B,C,k,b = twopointoneline(P,Q) # 直线方程标准式,k斜率,b截距
    #print("A,B,C,k,b",A,B,C,k,b)
    x,y = point
    #print("x y = ",x,y)
    return abs(A*x + B*y + C)<0.00000001     # 符合直线标准方程则返回真，否则假        
dot_is_on_line = point_is_on_line

def point_is_on_segment(point,segment):
    """判断点是否在线段上,
       point:二元组表示的点,segment:两个点表示的线段,如((10,10),(20,20))或[(0,0),(100,100)]"""
    P,Q = segment    
    x,y = point
    if point_is_on_line(point,segment):   # 如果在直线上,进一步判断是否在线段上
        x1 = P[0];x2 = Q[0] # 线段1的两个x坐标
        if x1>x2:x1,x2 = x2,x1         # 如果x1比x2大,则交换x1和x2的值
        if x>x2 or x<x1 : return False
        y1 = P[1];y2 = Q[1] # 线段1的两个y坐标
        if y1>y2:y1,y2 = y2,y1         # 如果y1比y2大,则交换y1和y2的值
        if y>y2 or y<y1 : return False
        return True
    else:
        return False
dot_is_on_segment = point_is_on_segment

def is_collinear(A,B,C):
    """判断三点是否共线"""
    line = B,C
    return point_is_on_line(A,line)
    
def segment_intersection(segment1,segment2):
    """返回两条线段的交叉点
       segment:两个点表示的线段,如((10,10),(20,20))或[(0,0),(100,100)]
    """
    jiaodian = line_intersection(segment1,segment2)   # 直线1和直线2的交点
    if jiaodian==None:return None
    if point_is_on_segment(jiaodian,segment1) and point_is_on_segment(jiaodian,segment2):
        x,y  = jiaodian
        return x,y    
    
def lc_intersection(line,circle):  # 直线与圆的交点
    """返回直线和圆的交点  
       line是用两点表示的直线,形如,((32,99),(0,0))或[(32,99),(0,0)]
       circle: 用圆心和半径表示的圆形，如[(0,0),100]，表示圆心在原点，半径为100的圆
    """
    if isinstance(circle,dict):
        radius,center = circle.copy().popitem()   # 弹出项目
    else:
        center = circle[0]                 # 取出圆心
        radius = circle[-1]                # 取出半径 

    _,_,_,m,c = twopointoneline(*line) # 算出直线一般式的参数,用斜截式,所以前三个参数不要
   
    p,q = center   # 下面根据y=mx+c和(x-p)**2+(y-q)**2=r**2解方程得
    
    if m != float('inf'):
        A = m**2+1
        B = 2*(m*c-m*q-p)
        C = q**2 - radius**2 + p**2 - 2*c*q + c**2
        delta = B**2 - 4*A*C
        
        if delta<0:return None
        if delta==0:              
            x = -B/(2*A)
            y = m * x + c
            return [(x,y)]
        else:
            x1 = -B/(2*A) + delta**0.5/(2*A)
            y1 = m * x1 + c
            x2 = -B/(2*A) - delta**0.5/(2*A)
            y2 = m * x2 + c
            return [(x1,y1),(x2,y2)]
    else:     # 斜率无穷大是垂直于x轴的直线
        k = line[0][0]
        A = 1
        B = -2*q
        C = p**2 + q**2 - radius**2 - 2*k*p + k**2
        delta = B**2 - 4*A*C
        
        if delta<0:return None
        if delta==0:              
            x = k
            y = -B/(2*A)
            return [(x,y)]
        else:
            x = k
            y1 = q + (radius**2-(k-p)**2)**0.5
            y2 = q - (radius**2-(k-p)**2)**0.5
            y1 = (-B + delta**0.5)/(2*A)
            y2 = (-B - delta**0.5)/(2*A)
            
            return [(x,y1),(x,y2)]

def is_on_circle(point,circle):
    """判断点是否在圆上
       point:用二元组表示的点,circle:中心点与半径表示的圆,如((0,0),100)"""
    if isinstance(circle,dict):
        radius,center = circle.copy().popitem()    # 弹出项目
    else:
        center = circle[0]                 # 取出圆心
        radius = circle[-1]                # 取出半径    
    a,b = center
    x,y = point
    # 下面根据圆的标准方程判断x,y是否在圆上
    return  (x-a)**2 + (y-b)**2 == radius**2 
point_is_on_circle = is_on_circle
dot_is_on_circle = is_on_circle

def cc_intersection(circle1,circle2):  # 圆与圆的交点
    """返回两个圆的交点，圆形用((10,10),50))或者[(10,10),50)]这样的数据表示。
       如赋值：circle1 = (c,r)，则c应该是用二元组表示的圆心,r应该是半径。
    """
    if isinstance(circle1,dict):
        radius,center = circle1.copy().popitem() # 弹出项目
        circle1 = (center,radius)
    if isinstance(circle2,dict):
        radius,center = circle2.copy().popitem() # 弹出项目
        circle2 = (center,radius)
        
    # 如果第一个圆更小,则交换,
    if circle1[-1] < circle2[-1]:
        circle1,circle2 = circle2,circle1
    c1,r1 = circle1           # 这个是更大的圆
    c2,r2 = circle2
    d = math.dist(c1,c2)     # 圆心距    
    if d > r1+r2:return None     # 外离
    elif abs(d-r1-r2)<0.1:     # 外切
        k = r1/r2
        return [pickpoint(c1,c2,k)]
    elif d== r1-r2:               # 内切
        t =Pointer(pos=c1)        # 新建指针对象
        j = t.towards(c2)             # 朝向c2坐标
        t.setheading(j)
        t.fd(r1)
        return [t.position()]
    elif d<r1-r2:return None             # 内含
    else: # 否则就是相交
        x,y = c1
        a,b = c2
        R = r1 ; S = r2                  # 大圆,小圆半径
        A = (R**2 - S**2 + d**2) / (2 * d)
        h = math.sqrt(R**2 - A**2)
        x2 = x + A * (a-x)/d
        y2 = y + A * (b-y)/d
        x3 = x2 - h * (b - y) / d
        y3 = y2 + h * (a - x) / d
        x4 = x2 + h * (b - y) / d
        y4 = y2 - h * (a - x) / d
        return [(x3,y3),(x4,y4)]
    
def __intersection_bak(item1,item2,combmode=0): # 不要用这个函数，已废 ，留尸而已
    """两个对象相交，仅支持点，直线，线段与圆
       item1与item2可表示：点，直线、线段、圆。
       本函数严格区分点，线段，直线的表示方法，我们默认以下规则：
       1.用二元组表示一个点，如(0,0)表示原点
       2.用在列表中的两个点表示线段，如[(0,0),(10,10)]表示从原点到(10,10)的线段。
       3.用在元组中的两个点表示经过两点的直线，如((0,0),(10,10))表示经过这两个点的直线。
       4.用点和半径表示圆，并用中括号括起来，如[(0,0),100]
       combmode表示组合模式，默认为0
       combmode=0，表示item1和item2都是直线。
       combmode=1：表示item1和item2都为线段。
       combmode=2：表示item1是直线，而item2为线段。
       combmode=3：表示item1为线段，而item2是直线。
       combmode=4：表示item1和item2都为圆形。
       combmode=5：表示item1是直线，item2为圆形。
       combmode=6：表示item1是线段，item2为圆形。
       combmode=7：表示item1是点，item2为直线。
       combmode=8：表示item1是点，item2为线段。
       combmode=9：表示item1是点，item2为圆形。       
    """
    mode = combmode
    if mode<0 or mode>9:mode=0
    
    if mode in (0,1,2,3):
        jd = line_intersection(item1,item2)
        if jd==None:return None     # 如果连两根直线都没有交点，那么无论模式是1，2，3，还是4都没必要判断了
        if mode==0:return jd        # 如果模式是0,直接返回两条直线的交点
        elif mode==1 :              # 如果模式是1，认为是两条线段             
             if point_is_on_segment(jd,item1) and point_is_on_segment(jd,item2): # 如果都在线段上才返回交点
                return jd
        elif mode==2: # 如果item1是直线，而且item2是线段，则只要求交点在item2上即可
             if point_is_on_segment(jd,item2):return jd        
        elif mode==3: # 如果item2是直线，而且item1是线段，则只要求交点在item1上即可
             if point_is_on_segment(jd,item1):return jd
    elif mode==4:            # 模式为4表示item1和item2都是圆
        return cc_intersection(item1,item2)
    elif mode in (5,6):
        jd = lc_intersection(item1,item2) # item1是直线或线段，item2是圆，如[(23,23),32]
        if jd==None:return None
        if mode==5:return jd
        elif mode==6:           # 如果模式为6，则要求item1是线段，即交点jd也要在线段范围内
            if point_is_on_segment(jd,item1):return jd
    elif mode==7:return point_is_on_line(item1,item2)       # 点是否在直线上
    elif mode==8:return point_is_on_segment(item1,item2)    # 点是否在线段上
    elif mode==9:return is_on_circle(item1,item2)           # 点是否在圆上

def intersection(item1,item2):   
    """两个对象相交，仅支持点，直线，线段与圆
       item1与item2可表示：点，直线、线段、圆。
       本函数严格区分点，线段，直线的表示方法，我们默认以下规则：
       1.用二元组表示一个点，如(0,0)表示原点
       2.用在列表中的两个点表示线段，如[(0,0),(10,10)]表示从原点到(10,10)的线段。
       3.用在元组中的两个点表示经过两点的直线，如((0,0),(10,10))表示经过这两个点的直线。
       4.用点和半径表示圆，用字典表示，{100:(0,0)}表示半径为100的圆心在(0,0)的圆形。
       mode=0，表示item1和item2都是直线。两元组。
       mode=1：表示item1和item2都为线段。两列表。
       mode=2：表示item1是直线，而item2为线段。元组与列表。
       mode=3：表示item1为线段，而item2是直线。列表与元组。
       mode=4：表示item1和item2都为圆形。字典和字典。
       mode=5：表示item1是直线，item2为圆形。元组和字典。
       mode=6：表示item1是线段，item2为圆形。列表和字典。
       mode=7：表示item1是点，item2为直线。元组和元组。
       mode=8：表示item1是点，item2为线段。元组和列表。
       mode=9：表示item1是点，item2为圆形。 元组和字典。
    """
    # 判断
    if isinstance(item1,tuple) and isinstance(item2,tuple):
        if not isinstance(item1[0],tuple): # 如果item1[0]不是元组，那么是个数值，则item1是个点
            mode = 7
        else:
            mode = 0
    elif isinstance(item1,list) and isinstance(item2,list):mode=1
    elif isinstance(item1,tuple) and isinstance(item2,list):  # 元组和列表，可能是直线与线段，也可能是点和线段
        if not isinstance(item1[0],tuple):  # 如果是个数值，则是个点
            mode = 8
        else:
            mode=2
    elif isinstance(item1,list) and isinstance(item2,tuple):mode=3
    elif isinstance(item1,dict) and isinstance(item2,dict):mode=4
    elif isinstance(item1,tuple) and isinstance(item2,dict):
        if not isinstance(item1[0],tuple): # 如果是个数值，则是个点
            mode=9
        else:
            mode=5
    elif isinstance(item1,list) and isinstance(item2,dict):mode=6

    # 模式确定完毕，正式调用相关函数
    if mode in (0,1,2,3):
        jd = line_intersection(item1,item2)         #返回二元组表示的交点坐标
        if jd==None:return None     # 如果连两根直线都没有交点，那么无论模式是1，2，3，还是4都没必要判断了
        if mode==0:return jd        # 如果模式是0,直接返回两条直线的交点
        elif mode==1 :              # 如果模式是1，认为是两条线段             
             if point_is_on_segment(jd,item1) and point_is_on_segment(jd,item2): # 如果都在线段上才返回交点
                return jd
        elif mode==2: # 如果item1是直线，而且item2是线段，则只要求交点在item2上即可
             if point_is_on_segment(jd,item2):return jd        
        elif mode==3: # 如果item2是直线，而且item1是线段，则只要求交点在item1上即可
             if point_is_on_segment(jd,item1):return jd
    elif mode==4:            # 模式为4表示item1和item2都是圆
        return cc_intersection(item1,item2)
    elif mode in (5,6):
        jd = lc_intersection(item1,item2) # item1是直线或线段，item2是圆，如{32:(23,23)}
        if jd==None:return None
        if mode==5:return jd
        elif mode==6:           # 如果模式为6，则要求item1是线段，即交点jd也要在线段范围内
            return [(x,y) for x,y in jd if point_is_on_segment((x,y),item1)]
                    
    elif mode==7:return point_is_on_line(item1,item2)       # 点是否在直线上
    elif mode==8:return point_is_on_segment(item1,item2)    # 点是否在线段上
    elif mode==9:return is_on_circle(item1,item2)           # 点是否在圆上
    
