def symmetric_points(points,center):          # 中心对称
    """中心对称,一些点关于center对称,返回列表，此列表中包括所有对称的点"""
    p1 = np.array(points)
    c = np.array([center])
    p2 = 2*c - p1
    p2 = [(x,y) for x,y in p2]
    return p2

def perpendicular_foot(p,line):
    """返回p点关于直线的垂足点,
       p:二元组表示的坐标点,line:由两个二元组形成的列表,如[(0,0),(100,100)]"""
    A2,B2,C2,k,b = twopointoneline(*line)#直线一般式的5个参数
    if k==0:
        A1=1;B1=0;C1=p[0]
        x = p[0];y=b
    else:
        A1,B1,C1 = kpointoneline(p,-1/k)#通过一点和斜率确定直线
        m = A1*B2 - A2*B1
        if m==0:return None
        x = (C2*B1-C1*B2)/m    #  交点(垂足点)
        y = (C1*A2-C2*A1)/m
    return x,y 

def axis_points(points,line):            # 轴对称
    """本函数求一些点关于直线line的轴对称点，返回一个列表"""
    p1,p2 = line
    A,B,C,*x = twopointoneline(p1,p2)
    rp = []
    def f(p,A,B,C):
        x,y = p
        t = (A*x+B*y+C)/(A*A+B*B)
        x = x - 2*A*t
        y = y - 2*B*t
        return x,y
    rp = [f(p,A,B,C) for p in points]     
    return rp

def homothetic_points(points,center,k):          # 位似
    """返回位似的多个点，
       points:坐标点,center:位似心中心,k:位似比"""
    c = center    
    return [(k*(c[0]-dot[0])+c[0],k*(c[1]-dot[1])+c[1])
            for dot in points]
dilate = homothetic_points

def is_same_direction(center,p,cor,k):
    """center：反演中心,p:待反演的点,cor:已经反演的点,k反演幂"""
    O = Vec2D(*center)
    OA = Vec2D(*p) - O
    OA_ = Vec2D(*cor) - O
    return np.sign(OA*OA_)==np.sign(k)
    
def inverting_points2_(points,center,k):          # 反演
    """本人算法,暂时不用以作纪念,反演的多个点:points,center:位似心中心,k:反演常数"""
    cors = []
    a,b = center
    for p in points:
        c,d = p
        length = math.dist(p,center)
        if c-a != 0:
            slope = (d-b)/(c-a)            # 斜率,c-a不等于0的情况            
            # 设反演点坐标,x,y,列以下方程
            # length * sqrt((x-a)**2 + (y-b)**2)=k
            # (y-b)/(x-a) = slope
            x = (k**2/(length**2 * (1+slope**2)))**0.5 + a
            y = slope*(x-a) + b
            # 判断方向是否和k相同
            if not is_same_direction(center,p,(x,y),k):
                x = -(k**2/(length**2 * (1+slope**2)))**0.5 + a
                y = slope*(x-a) + b           
        else:
            x = a
            y = b + k/length
            if not is_same_direction(center,p,(x,y),k):
                y = b - k/length                
        cors.append((x,y))
        
    return cors

def inverting_points(points,center,k):          # 反演
    """反演的多个点:points,center:位似心中心,k:反演常数
       公式来自:https://mathworld.wolfram.com/Inversion.html
    """
    def mappoint(x0,y0,x,y,k):
        d = (x-x0)**2 + (y-y0)**2
        x1 = x0 + k*(x-x0)/d
        y1 = y0 + k*(y-y0)/d
        return x1,y1
    x0,y0 = center  
    return [mappoint(x0,y0,x,y,k) for x,y in points]  

def get_angle(A,B,C):      # 余弦定理的应用,三点求角度
    """得到角ABC的大小,A,B,C是三角形三个顶点坐标,以二元组表示"""
    a = BC = math.dist(B,C)
    b = AC = math.dist(A,C)
    c = AB = math.dist(A,B)    
    if a*c==0:
        jiao = 0
    else:
        k = (c*c + a*a - b*b)/(2*a*c)
        jiao = math.degrees(math.acos(k))
    if three_point_order(A,B,C)<0:jiao = 360-jiao  # 如果三点是顺时针
    return jiao
    
def angle_bisector(A,B,C): # 角平分线
    """使用角平分线定理求角平分线和对边的交点，
       A,B,C是三个以二元组表示的点，求角平分线,返回从B点出发的角平分线和AC的交点"""
    a = BC = math.dist(B,C)
    b = AC = math.dist(A,C)
    c = AB = math.dist(A,B)
    k = c/a
    return pick_point(A,C,k)

def perpendicular_bisector(segment,length=100): # 中垂线
    """segment:线段，由两个点表示，如[(0,0),(100,100)]，返回垂直平分线两端点坐标"""
    p1,p2 = segment
    p = midpoint(p1,p2)                       # 中点
    A,B,C,k,b = twopointoneline(p1,p2) # 根据两点定直线返回一般式的参数
    t = Pointer(pos=p1)
    j = t.towards(p2)
    t.setheading(j)
    dis = math.dist(p1,p2)
    t.fd(dis/2);t.left(90);t.fd(length/2);dot1 = t.position()
    t.bk(length);dot2 = t.position()
    return dot1,dot2
    
def parallel_line(line,p,length=100):
     """line表示直线，如((0,0),(10,3))，p表示直线外的一个点,返回平行线两端点坐标"""
     p1,p2 = line
     t = Pointer(pos=p1)
     j = t.towards(p2)
     t.setheading(j)
     t.goto(p);t.fd(length/2);dot1=t.position()
     t.bk(length);dot2 = t.position()
     return dot1,dot2    

def circle_on_tangent(circle,point,length=100): # 圆上切线 
    """圆上的切线,默认长度100),返回两个点
       circle：圆形，用[(0,0),100]这样的数据表示一个圆
       point：点，用二元组表示的点，如(10,10)
    """
    if isinstance(circle,dict):
        radius,center = circle.copy().popitem()     # 弹出项目
    else:
        center,radius = circle
    p = point
    t = Pointer(pos=center)
    j = t.towards(p);t.setheading(j)
    t.fd(radius); t.left(90);t.fd(length/2);dot1 = t.position()
    t.bk(length);dot2 = t.position()
    return dot1,dot2

def circle_out_tangent(circle,point):   # 圆外切线
    """圆外一点到圆的两条切线,返回两个点
       circle：圆形，用[(0,0),100]这样的数据表示一个圆
       point：点，用二元组表示的点，如(10,10)
    """
    if isinstance(circle,dict):
        radius,center = circle.copy().popitem() # 弹出项目
    else:
        center,radius = circle
    p = point
    dis = math.dist(center,p)
    if dis > radius:
        t = Pointer(pos=p)
        j = t.towards(center);t.setheading(j)
        d = math.dist(center,p)
        angle = math.degrees( math.acos(radius/d) )
        t.fd(d);t.right(180-angle);t.fd(radius);dot1 = t.position()
        t.bk(radius);t.right(2*angle);t.fd(radius);dot2 = t.position()
        return dot1,dot2    

