def scale_points(points,h,v):
    """在水平方向和垂直方向“缩放”所有的点,即乘以相应的倍数"""    
    cors = np.array(points)
    scale = np.array([h,v])
    return [tuple(dd) for dd in (cors*scale)]
    
def rotate_points(points,center=(0,0),degree=1):
    """一些点绕着center点逆时钟旋转,每次旋转degree度
      points是包括一些2D坐标点的列表或元组，返回列表。
    """
    center = Vec2D(*center)
    points= [Vec2D(x,y) for x,y in points] # 转换为向量
    points = [C-center for C in points]
    points = [C.rotate(degree) for C in points]
    points = [C+center for C in points]
    points = [(x,y) for x,y in points]
    return points

def move_points2(cors,dx,dy=0):                   # 水平与垂直方向平移
    """平移点,cors:要移的点,是一个列表,列表中有一些二元组,
        dx,dy分别是水平和垂直方向的移动距离
    """    
    cors = np.array(cors)
    step = np.array([dx,dy])
    return [tuple(dd) for dd in (cors+step)]
translate = move_points2                     # 平移的别名

def move_points(cors,distance,angle):              # 朝个方向平移点
    """平移点,cors:要移的点,是一个列表,列表中有一些二元组,
        distance:要移动的距离,angle:移动的方向值
    """
    a = math.radians(angle)
    dx = distance*math.cos(a)
    dy = distance*math.sin(a)
    return move_points2(cors,dx,dy)

def convert_cross_xy(points):
    """把坐标转换成以图像左上角为原点的,points是列表,存储一些坐标点"""
    min_x = min([x for x,y in points])
    max_x = max([x for x,y in points])
    width = max_x - min_x
    center_x  = (min_x+max_x)/2
    min_y = min([y for x,y in points])
    max_y = max([y for x,y in points])
    height = max_y - min_y
    center_y  = (min_y+max_y)/2
    # 坐标平移转换
    points = [(x-min_x,y-max_y) for x,y in points]
    points = [(x,-y) for x,y in points]
    center = center_x,center_y           # 图像的中心
    return points,center

def poly2image(points,fill='white',outline=None):
    """多边形转图像,points:Python海龟画图中的一些坐标点,返回图像与原多边形的绑定盒中心
    """
    points ,center = convert_cross_xy(points)  # 把平面直角坐标系转换为以左上为原点的坐标系
    
    image = ImagePath.Path(points).getbbox()    
    size = list(map(int, map(math.ceil,image[2:])))
    size = size[0]+1,size[1]+1
    img = Image.new("RGBA", size)  
    img1 = ImageDraw.Draw(img)   
    img1.polygon(points, fill=fill, outline =outline)  
    return img ,center

def make_rect_image(length,height,fill=(198,155,25,128),outline=None):
    """产生矩形图像，返回pillow图形对象。"""    
    A = (0,0)               # 左下角坐标
    B=(length-1,0)          # 右下角坐标
    C=(length-1,height-1)   # 右上角坐标
    D=(0,height-1)          # 左上角坐标
    im,_ = poly2image([A,B,C,D],fill=fill,outline=outline)
    return im

def make_oval_image(a,b=None,fill=(255,255,255,255)):
    """a:长半轴,b:短半轴,产生椭圆图形,fill是填充色"""
    if b==None:b=a
    w,h = 2*a,2*b
    size = w,h
    im = Image.new("RGBA",size,(0,0,0,0)) # 新建RGBA格式无色图
    draw = ImageDraw.Draw(im)
    draw.ellipse((0,0,w-1,h-1),fill=fill)
    return im    

def centroid(A,B,C):         # 重心,三条中线交点
    """返回三角形的重心,中线交点"""
    return (A[0]+B[0]+C[0])/3,(A[1]+B[1]+C[1])/3

def incenter(A,B,C):         # 内心,三条角平分线的交点
    """返回三角形的内心，角平分线交点"""
    x1,y1 = A
    x2,y2 = B
    x3,y3 = C
    BC = a = math.dist(B,C)
    CA = b = math.dist(C,A)
    AB = c = math.dist(A,B)
    p = a + b + c
    return (a*x1+b*x2+c*x3)/p,(a*y1+b*y2+c*y3)/p

def excenter(A,B,C):         # 外心,三条中垂线的交点
    """返回三角形的外心，垂直平分线交点"""
    x1,y1 = A
    x2,y2 = B
    x3,y3 = C
    A1 = 2*(x2-x1)
    B1 = 2*(y2-y1)
    C1 = x2*x2+y2*y2-x1*x1-y1*y1
    A2 = 2*(x3-x2)
    B2 = 2*(y3-y2)
    C2 = x3*x3 + y3*y3 - x2*x2 - y2*y2
    P = (A1*B2-A2*B1)
    x = (C1*B2-C2*B1) / P
    y = (A1*C2-A2*C1) / P
    return x,y
circumcenter = excenter

def orthocenter(A,B,C):         # 垂心,三条高的交点
    """返回三角形的垂心，三条高的交点"""
    x1,y1 = A;    x2,y2 = B;    x3,y3 = C    
    BC = a = math.dist(B,C)
    CA = b = math.dist(C,A)
    AB = c = math.dist(A,B)
    cosA = (b*b + c*c - a*a)/(2*b*c)
    if cosA==0:return A
    aA = a/cosA
    cosB = (a*a + c*c - b*b)/(2*a*c)
    if cosB==0:return B
    bB = b/cosB
    cosC = (b*b + a*a - c*c)/(2*a*b)
    if cosC==0:return C
    cC = c/cosC
    p = (aA + bB + cC)
    x = (aA * x1 + bB*x2 + cC*x3)/p
    y = (aA * y1 + bB*y2 + cC*y3)/p    
    return x,y

def path2points(path,step=2):
    """把路径中每隔step距离的点算出来放在列表中，返回此列表。
       path: 一个列表,里面有一些点，step:步长，点之间距离。
    """
    for i in range(1,len(path)):
        start = path[i-1]
        station = path[i]
        d = math.dist(start,station)
        amounts = 1+int(d/step)
        arr = np.linspace(start,station,amounts)
        if i==1:
           arr1 = arr 
        else:
           arr1 = np.concatenate((arr1,arr),axis=0) 
    return list(map(tuple,arr1))

def constrain(value, min_, max_): # 约束,限制函数,将value限定在指定范围内,可以不用if写得更优雅,有空再重写
    if min_ > max_:min_,max_ = max_,min_
    if value >= max_:value = max_
    elif value <= min_:value = min_
    return value

def point_in_polygon(point,polygon):
    """
    返回点是否在多边形中，如果在则返回真，否则返回假，用的经典的射线法。
    point：一个二元组表示的点,如(2,3)
    polygon：多个点组成的多边形，如[(0,0),(1,0),(1,1),(0,1)]
    本函数参考代码来源：https://www.algorithms-and-technologies.com/point_in_polygon/python
    """
    odd = False    
    i = -1
    j = len(polygon) -1
    while i < len(polygon) - 1:
        i = i + 1
        if (((polygon[i][1] > point[1]) != (polygon[j][1] > point[1])) and (point[0] < (
                (polygon[j][0] - polygon[i][0]) * (point[1] - polygon[i][1]) / (polygon[j][1] - polygon[i][1])) +
                                                                            polygon[i][0])):
            
            odd = not odd
        j = i    
    return odd

def bounds(polygon):
    """返回多边形绑定盒，即最小包围矩形"""
    minx = min([x for x,y in polygon]) # 最小x坐标
    maxx = max([x for x,y in polygon]) # 最大x坐标
    miny = min([y for x,y in polygon]) # 最小y坐标
    maxy = max([y for x,y in polygon]) # 最大y坐标
    return minx, miny, maxx, maxy
    
def random_points_in_polygon(polygon, number=1):
    """在多边形内产生一定数量的随机点，
       polygon:多边形，如[(0,0),(10,0),(10,10)]
       number：数量"""
    points = []
    minx, miny, maxx, maxy = bounds(polygon)
    while len(points) < number:
        dot = np.random.uniform(minx, maxx), np.random.uniform(miny, maxy)
        if point_in_polygon(dot,polygon):
            points.append(dot)
         
    return points


def heron_formula(A,B,C):
    """运用海伦公式求三角形面积，A，B，C是三个不共线的坐标点
    """
    a = math.dist(B,C);b = math.dist(A,C);c = math.dist(B,A)
    p = (a+b+c)/2
    return (math.sqrt(p*(p-a)*(p-b)*(p-c)),p ) # 注意返回的是面积与周长的一半
    
def circumcircle(A,B,C):              # 三点定圆
    """返回外接圆的圆心和半径,A,B,C是不共线的三个点"""
    a = math.dist(B,C);b = math.dist(A,C);c = math.dist(B,A)
    p = (a+b+c)/2
    s = math.sqrt(p*(p-a)*(p-b)*(p-c))
    r = a*b*c/(4*s)
    return (circumcenter(A,B,C),r)

def incircle(A,B,C):
    """返回内切圆的圆心和半径,A,B,C是不共线的三个点"""
    s,p = heron_formula(A,B,C)  # 返回的三角形面积和周长的一半
    r = s/p
    return (incenter(A,B,C),r)

def inflection_points(polyline):
    """返回折线的拐点,polyline是一个点集，如[(0,0),(10,10),(20,20),(20,30)]"""
    points = polyline
    guaidians = []
    i=0;j=1;k=2
    while k<len(points):
        p1 = points[i]
        p2 = points[j]
        p3 = points[k]
        if not is_collinear(p1,p2,p3):
            guaidians.append(p2)
        i = i + 1;j = j + 1;k= k + 1
    return guaidians

def adjust_pts_order(points):
    """逆时钟排序坐标点 ，只适合于凸多边形"""
    cen_x, cen_y = np.mean(points, axis=0)    
    d2s = []
    for i in range(len(points)):
        o_x = points[i][0] - cen_x
        o_y = points[i][1] - cen_y
        atan2 = np.arctan2(o_y, o_x)
        if atan2 < 0:
            atan2 += np.pi * 2
        d2s.append([points[i], atan2])
    d2s = sorted(d2s, key=lambda x:x[1])
    order_2ds = np.array([x[0] for x in d2s])
    return order_2ds
 

# 以下定义屏幕的鼠标移动事件
def __onmousemove(self, fun, add=None):
    """绑定鼠标移动事件"""
    
    if fun is None:
        self.cv.unbind("<Motion>" )
    else:
        def eventfun(event):
            x, y = (self.cv.canvasx(event.x)/self.xscale,
                    -self.cv.canvasy(event.y)/self.yscale)
            fun(x, y)
        self.cv.bind("<Motion>", eventfun, add)

def _onmousemove(self,fun,add=None):
    """绑定鼠标移动事件"""
    self.__onmousemove(fun,add)

TurtleScreenBase.__onmousemove = __onmousemove
TurtleScreenBase.onmousemove = _onmousemove

# 重定义_drawimage方法
def _drawimage(self, item, pos, image):
    """在画布x,y坐标重新配置image
    """
    x, y = pos
    self.cv.coords(item, (x * self.xscale, -y * self.yscale))
    self.cv.itemconfig(item, image=image)
    self.cv.tag_raise(item)
TurtleScreenBase._drawimage = _drawimage

def txt2image(txt,filename=None,fontfile="msyh.ttf",fontsize=18,color=(25,0,255,255),bg=0):
    """
        文本转图像实用小程序,只支持单行文本,默认为微软雅黑字体,
        txt：文本
        filename：要写入的文件名，如果为空则不写入，并且返回图形对象
        fontfile:ttf字体文件
        fontsize:字体大小
        color:颜色,通过写alpha值可支持半透明图形。
        bg:背景颜色
    """
    txt = str(txt)
    windowsdir = os.environ.get('WINDIR')
    try:
       fnt = ImageFont.truetype(fontfile,fontsize)
    except:
       fontfile = 'msyh.ttc'                      # win10的微软雅黑为ttc
       fnt = ImageFont.truetype(windowsdir + os.sep + 'fonts' + os.sep + fontfile,fontsize)
    
    size = fnt.getsize(txt)
    pic = Image.new('RGBA', size,color=bg)
    
    d = ImageDraw.Draw(pic)
    d.text((0,0),txt,font=fnt,fill=color)
    if filename!=None:
        pic.save(filename)
        return size
    else:
        return pic
      
def txt3image(txt,filename=None,fontfile='msyh.ttf',fontsize=18,color=(25,0,255,255),bg=0):
    """多行文本转换成图像的命令
    txt：待转换所多行文本
    filename：输出文件名
    fontfile：ttf字体文件
    fontsize：字体大小
    color：字体颜色
    bg:背景颜色
    """
    lines = txt.split("\n")    
    images = []                      # 存储单行图像对象 
    sizes = []                       # 每个图形对象的宽高
    width = 0                        # 所生成的图像文件宽度
    height = 0                       # 所生成的图像文件高度    
    for line in lines:               # 文件中的每一行
      info = line
      if info =='':info="\n"
      im = txt2image(info,fontfile=fontfile,fontsize=fontsize,color=color,bg=bg)
      images.append(im)
      w,h = im.size                  # 单行文本转换成图形对象后的宽高      
      if w > width : width = w       # 记录最大宽度
      height += h                    # 记录总高度
      sizes.append((w,h))
    pic = Image.new('RGBA', (width,height))
    index = 0
    height = 0
    for im in images:                # 刚才按行生成的每个图形对象
      box = (0,height)
      pic.paste(im,box)              # 把im贴在pic上，坐标为box 
      w,h = sizes[index]             # 取出宽高
      height = height + h
      index = index + 1
      
    if filename==None:               # 如果文件名为空则返回图像对象
       return pic
    else:                            # 否则直接保存为图像，并且返回宽高 
       pic.save(filename)
       return pic.size 


def txt4image(txtfile=None,filename=None,fontfile="msyh.ttf",fontsize=18,color=(25,0,255,255),bg=0):
    """把文本文件转换成图像的函数
      txtfile：文本文件名，为空则读取程序文件本身。
      filename：要转换所图像文件名，为空则返回im图像对象。
      fontfile：ttf字体文件，
      fontsize：字体大小
      color：字体颜色
      bg:背景颜色
    """
    if txtfile==None:txtfile=sys.argv[0]
    try:
      f = open(txtfile,encoding='utf-8')
      c = f.read()
      f.close()
    except:
      f = open(txtfile)
      c = f.read()
      f.close()      
    if filename==None:
       return txt3image(c,fontfile=fontfile,fontsize=fontsize,color=color,bg=bg)
    else:
       size = txt3image(c,filename=filename,fontfile=fontfile,fontsize=fontsize,color=color,bg=bg)
       return size

def _convertpos(x,y):
    """把x,y坐标转换回以左上角为原点的x,y坐标，和屏幕的缩放参数scale无关。"""
    if Turtle._screen is None:return
    screen = Screen()            # 返回屏幕对象
    x =  x + screen.window_width() //2
    y =  screen.window_height() //2 - y
    return x,y
  
def _cut_sub_rect(sprite,rect):
    """返回相对于sprite所在矩形的子矩形，当然，只适合于图像造型
       这个子矩形的左上角坐标以sprite左上角坐标为原点的。    
    """         
    left,top,right,bottom = sprite.bbox()
    left1,top1 = _convertpos(left,top)
    left2,top2,right2,bottom2 = rect
    left2,top2 = _convertpos(left2,top2)
    right2,bottom2 = _convertpos(right2,bottom2)
    dleft = int(left2 - left1)
    dtop = int(top2 - top1)
    dright = int(right2 - left1)
    dbottom = int(bottom2 - top1)
    return dleft,dtop,dright,dbottom
  
def _make_mask(sprite,rect,threshold=127):
    """
    sprite：角色，rect：重叠区域矩形(相对于整个屏幕坐标系)
    坐标系以左上角为原点的，截取角色子矩形区域的alpha形成mask
    最后形成的mask是一个numpy二维数组，1代表不透明区域，0代表透明区域。
    threshold是域值，大于这个值，则认为是不透明的，否则为透明。
    """
    im = np.array(sprite._current_im)       # 角色当前的图形对象转换成numpy数组
    
    alpha = im[:, :, 3]                     # 提取所有透明通道的alpha值
    left,top,right,bottom = _cut_sub_rect(sprite,rect) # 相对于角色左上角的子矩形
    
    alpha = alpha[top:bottom,left:right]    # 子矩形的alpha通道所有值
    
    mask = alpha > threshold                # 大于threshold的认为不透明
    mask.dtype=np.uint8                     # 转换成整数
    return (mask,(left,top,right,bottom))   # 返回遮罩和以左上角为原点的相对矩形

