# 缩放矩形函数
def _scale_rect(sourcerect,scale):
    """缩放矩形，按比例对源矩形进行放大或缩小
       sourcerect：源矩形，4元组，左上角和右下角坐标
       scale：比例
    """
    left,top,right,bottom = sourcerect
    width = right - left
    height = top -bottom
    x0 = left + width/2
    y0 = bottom + height/2
    
    x1 = x0 - 0.5 * width * scale
    y1 = y0 + 0.5 * height * scale
    x2 = x0 + 0.5 * width * scale
    y2 = y0 - 0.5 * height * scale

    return x1,y1,x2,y2
  
