def fill(x,y,fillcolor='black',mode=2):  # 单独的填充命令,方便配合turtle模块使用
    """单独的填充命令，为了让turtle能使用sprites中的fill，所以编写这个函数。它会建一个隐藏的角色用于fill"""
    if Turtle._screen is None:return    
    screen = Screen()            # 返回屏幕对象
    if not hasattr(screen,'_fill_sprite'):  # 第一次没这个属性,则建立专用于填充的角色
        screen._fill_sprite =  Sprite('blank',visible=False)
    screen._fill_sprite.fillcolor(fillcolor)
    contours,innters = screen._fill_sprite.fill(x,y,mode=mode)
    return contours,innters
    
def find_in_square(x,y,half_length=1):    
    """返回以x,y为方形中心点坐标,half_length为半边长内的所有角色"""        
    if Turtle._screen is None:return    
    screen = Screen()            # 返回屏幕对象
    cv = screen.getcanvas()      # 得到画布
 
    w = screen._window_size()[0]
    h = screen._window_size()[1]
    x1 = x - half_length
    y1 = y + half_length
    x2 = x + half_length
    y2 = y - half_length
    
    y1 =  - y1
    y2 =  - y2       
 
    items = set(cv.find_overlapping(x1,y1,x2,y2))  #  和x1,y1,x2,y2矩形重叠的所有items
 
    sps = [t for t in screen._turtles if hasattr(t,"_id")]  # 所有角色
    t = [sp for sp in sps if sp.turtle._item in items]        # 挑出和self有矩形重叠的角色
    return t

    
findinsquare = find_in_square               # 在x,y圆心,radius半径内查找角色

class Key:
    def __init__(self,key):
        self._list = []                  # 2022/1/29新增用于判断按下并松开
        self.screen = Screen()
        self._key = key
        self._down = False
        self.bind()

    def bind(self):
        """绑定2022/3/29加"""
        self.screen.onkeypress(self._press, self._key)
        self.screen.onkeyrelease(self._release, self._key)

    def unbind(self):
        """取消绑定2022/3/29加"""
        self.screen.onkeypress(None, self._key)
        self.screen.onkeyrelease(None, self._key)
        
    def downup(self):
        """按了再松开"""
        
        if len(self._list) >= 2:
            t = self._list[-1] == False and self._list[-2]==True
            if t:self._list.clear()
            return t
    isdownup = downup
    
    def up(self):
        """松开按键"""
        if len(self._list)==0 or self._list[-1] == False:            
            return True
        else:
            return False
    isup = up
    
    def _press(self):
        self._list.append(True)
        self._down = True

    def _release(self):
        self._list.append(False)
        self._down = False

    def down(self):
        if len(self._list)>3:self._list.pop(0)
        return self._down
    isdown = down

class Mouse:
    def __init__(self,number=1):
      self._list = []                  # 2022/1/29新增用于判断按下并松开
      self.screen = Screen()                    
      self._number = number
      self._down = False
      self._pos = None                  # 记录单击点的坐标位置
      self.bind()
      
    def bind(self):
      """绑定2022/3/29加"""
      self.screen.onclick(self._press,self._number)
      self.screen.onscreenrelease(self._release,self._number)
      
    def unbind(self):
      """取消绑定,2022/3/29加"""
      self.screen.onclick(None,self._number)
      self.screen.onscreenrelease(None,self._number)

    @property                         # 2022/2/3增加用于获取单击处坐标
    def pos(self):
        return self._pos
    
    @property
    def position(self):
        return self._pos
    
    def downup(self):
        """按了再松开"""
        if len(self._list) >= 2:            
            t = self._list[-1] == False and self._list[-2]==True
            if t:self._list.clear()
            return t
    isdownup = downup
        
    def up(self):
        """松开按键"""
        if len(self._list)==0 or self._list[-1] == False:            
            return True
        else:
            return False
    isup = up
        
    def _press(self,x,y):
        self._list.append(True)
        self._down = True       
        self._pos = x,y
        
    def _release(self,x,y):
        self._list.append(False)
        self._down = False
        self._pos = x,y
        
    def down(self):
        if len(self._list)>3:self._list.pop(0)
        return self._down
    isdown = down

