widgets_function = """
def {0}(x=0,y=0,**kw):
    '''默认在画布的绝对坐标新建一个{1},
    x,y:坐标(以左上为原点),参数和tkinter中含义一样
    如果写了master参数,则自己用pack,place,grid等进行布局。
    '''
    if Turtle._screen is None:return
    cv = Turtle._screen.cv._canvas
    if 'master' not in kw:
        widget = TK.{0}(master=cv,**kw)
        widget.place(x=x,y=y)
    else:
       widget = TK.{0}(**kw)  # 说明用户自己写了master参数
    
    return widget
"""
for wd,value in some_widgets.items():
    fc = widgets_function.format(wd,value)
    exec(fc)
    
